import styles from './Videos.module.css'

const Videos = () => {
    return (
        <div className={styles.videoCont}>
            <video className={styles.vid} muted id='videos'>
                <source src='https://adobeprod-a.akamaihd.net/3VmbNS2Ydok/image/3VmbNS2Ydok_poster.jpg?hdnea=st%3D1633008975%7Eexp%3D1633268175%7Eacl%3D%2Fshared_assets%2Fimage%2F*%21%2Fz%2F3VmbNS2Ydok%2Frend%2F*%21%2Fi%2F3VmbNS2Ydok%2Frend%2F*%21%2F3VmbNS2Ydok%2Frend%2F*%21%2F3VmbNS2Ydok%2Fimage%2F*%7Ehmac%3Dddd2d8f539a10fa507b8e456634357e55fba98299a31b6169a7b64d4281b7c58' type='video/mp4'/>
            </video>

        </div>
    )
};

export default Videos;
